import axios from 'axios';

const url = "https://cloud.jdpower.ai/data-api/UAT/valuationservices/valuation/"

export function getYears() {
    return dispatch => {
        axios.get(url + 'years?period=0', {
            headers: {"api-key": "8b159d1f-7b81-4499-8cb2-ed3f80f25924"}
        }).then(res => {
            console.log(res.data)
            dispatch({
                type: 'GET_YEARS',
                years: res.data
            })
        })
    }
}

export function getMakes(year) {
    return dispatch => {
        axios.get(url + `makes?period=0&vehicletype=UsedCar&modelyear=${year}`, {
            headers: {"api-key": "8b159d1f-7b81-4499-8cb2-ed3f80f25924"}
        }).then(res => {
            dispatch({
                type: 'GET_MAKES',
                years: res.data
            })
        })
    }
}

export function getModels(year, make) {
    return dispatch => {
        axios.get(url + `models?period=0&`)
    }
}

export default function reducer(years = [], action) {
    switch(action.type) {
        case "GET_YEARS":
            return action.years
        case "GET_MAKES":
            return action.years
        default:
            return years
    }
}
